import React, { Component } from 'react';
import './App.css';
import './styles/style.css';
import About from './components/about';

class App extends Component {
  render() {
    return (
        <div id="hero-section">
          <h1>Brandon Jernigan</h1>
          <p class="paragraph-4">UX designer</p>
          </div>
    );
  }
}

export default App;
